    height: 100vh;
    width: 100vw;
    background: #00021c;
    opacity: 0;
    animation: show .3s ease 1s;
    animation-fill-mode: forwards
  }

  .init-loading span {
    display: inline-block;
    width: 5px;
    border-radius: 4px;
    animation: load 1s ease infinite
  }

  @keyframes show {
    0% {
      opacity: 0
    }
    100% {
      opacity: 1
    }
  }

    0%, 100% {
      height: 30px;
      background: rgba(47, 84, 235, .4)
    }
    50% {
      height: 60px;
      margin: -15px 0;
      background: #2f54eb
    }
  }

  .init-loading span:nth-child(2) {
    animation-delay: .2s
  }

  .init-loading span:nth-child(3) {
    animation-delay: .4s
  }

  .init-loading span:nth-child(4) {
    animation-delay: .6s
  }

  .init-loading span:nth-child(5) {
    animation-delay: .8s
  }</style>
